import photo2 from './product.jpg'

function Detail() {
  return (
    <div className='detail'>
        <div className='detail-left'>
            <img className='detail_photo'
                src={photo2}
                alt="" />

        </div>
        
        
        
    </div>
  )
}

export default Detail
